func (plgb *ProxyListGroupBy) sqlScan(ctx context.Context, v interface{}) error {
	for _, f := range plgb.fields {
		if !proxylist.ValidColumn(f) {
			return &ValidationError{Name: f, err: fmt.Errorf("invalid field %q for group-by", f)}
		}
	}
	selector := plgb.sqlQuery()
	if err := selector.Err(); err != nil {
		return err
	}
	rows := &sql.Rows{}
	query, args := selector.Query()
	if err := plgb.driver.Query(ctx, query, args, rows); err != nil {
		return err
	}
	defer rows.Close()
	return sql.ScanSlice(rows, v)
}

func (plgb *ProxyListGroupBy) sqlQuery() *sql.Selector {
	selector := plgb.sql
	columns := make([]string, 0, len(plgb.fields)+len(plgb.fns))
	columns = append(columns, plgb.fields...)
	for _, fn := range plgb.fns {
		columns = append(columns, fn(selector))
	}
	return selector.Select(columns...).GroupBy(plgb.fields...)
}

